import React, {useState, useEffect} from 'react';
import './App.css';
// import BookCard from './components/bookCard';

function App() {
  const [books, setBooks] = useState([]);
  useEffect(() => {
    async function fetchData() {
      setBooks(
        fetch('http://localhost:8888')
        .then(res => res.json())
        .then(res => console.log(res))
      )
    }
    fetchData();
  },[]);
  return(
    <div className="App">
      <header>
        <h1>Hello World</h1>
      </header>
    </div>
  );
}

export default App;
